import React, { useState } from 'react';

function Home() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        alert(`Username: ${username} Password: ${password}`);
    }
}

export default Home;
